10/uiq9XSQRSVg.jpg','Кристи','Шороваева',1,621,0),(144,'Продам дом в Новоандреевке! Все вопросы в личку',4,1433441995,1433442256,1,'971',59379473,'http://cs322817.vk.me/v322817473/b779/LnRK5f0HIM0.jpg','Андрей','Стельмащук',113,264,0),(145,'7 правил, благодаря которым исполняются желания<br><br>Хотите, чтобы Ваше желание исполнилось? Читайте семь эзотерических правил!<br><br>Эзотерики считают, что наши желания исполнятся, если мы их правильно запишем. Дело в том, что те торнадо мыслей, которые крутятся у нас в голове, не могут быть зафиксированы Вселенной как желание. А вот если вы сумеете сосредоточиться на своем желании и следовать СЕМИ правилам, ваши желания обязательно сбудутся! Читайте, вникайте и забирайте на стену, чтобы не потерять.<br><br>Правило 1. Желание необходимо написать…<br>Обязательно запишите Ваше желание, старательно и красивым почерком. Легко сказать, но трудно сделать! Несмотря на кажущуюся простоту, правильно написать своё желание не так-то просто.<br><br>Давайте разберём на примерах: «Я хочу иметь свой дом». Правильно написано? Оказывается принципиально неправильно! Проблема в том, что такое желание может исполниться, но возникает вопрос: когда? Желания без точных сроков бессмысленны! Помните это. Поэтому следующее правило гласит:<br><br>Правило 2. Желание должно иметь время исполнения<br>Например: «Летом 2015 года я буду иметь большой, красивый коттедж». А вот если Вы станете думать: «Я куплю коттедж», – это будет ошибочно. Написанное Вами, возможно, сбудется. Но в какое время – неизвестно. Поэтому прежде, чем писать желание, подумайте, когда вы хотите, чтобы оно исполнилось? (В разумных пределах, конечно). И только после этого приступайте к третьему правилу эзотерики:<br><br>Правило 3. Записывайте желание в настоящем времени<br>Иначе говоря, вместо: «Я куплю себе дом», надо написать: «Я купил себе дом». Важнейший момент! Т.е – вы должны представить, что дом у вас уже ЕСТЬ! Вот еще одна часто встречающаяся ошибка: «Я не хочу быть бедным». Правильно написано? Да нет же, неправильно! И на то есть весомые причины.<br><br>Вселенная не воспринимает частицу «не», предлог «нет» и другие отрицательные слова. Вы говорите: «Не хочу быть бедным», а она, Вселенная, игнорируя частицу «не», получает посыл: «Хочу быть бедным!»<br>- Мы как магнит притягиваем к себе то, о чём помышляем. Говоря себе: «Я не желаю быть бедняком», Вы автоматически притягиваете к себе бедность, поскольку (как мы уже говорили) <br>- Вселенная не воспринимает отрицательную частицу «не». Поэтому лучше говорить так: «Я хочу быть богатым и буду богатым!»<br><br>Правило 4. Запретите себе говорить: «не» и любые иные отрицания<br>Когда станете писать желание, обязательно сосредоточьтесь на нём и опишите его как можно подробнее. Отсюда вытекает правило номер пять:<br><br>Правило 5. Пишите подробно, эмоционально, с душой<br>Если Вы хотите заиметь новый дом, опишите его полностью, начиная от крыльца, расположения и количества комнат, заканчивая местечком, где поставите свою любимую вазу. Представьте свой восторг, когда въедете в новый дом и опишите его на бумаге. ОЧЕНЬ важно, чтобы Ваше желание не причинило вред другим людям, из этого постулата вытекает правило шестое:<br><br>Правило 6. Записанное желание завершите молитвой или фразой-оберегом<br>Записав желание, смиренно попросите помощи Высших Сил. Если Вы верите в Бога – помолитесь об исполнении желания. Если атеист – придумайте свою фразу-оберег. Например: «Пусть мой будущий дом наполниться радостью и счастьем. Пусть мои дети и внуки продолжат здесь свой род и наполнят жизнь свою и мою любовью. Пусть это моё желание принесёт мне не только счастье, но и нечто большее».<br><br>Обратили внимание на формулировку: «нечто бОльшее?» Не нужно ограничивать Вселенную в ее усилиях помочь вам. Может быть, она сочтёт Вас достойным не только загаданного Вами желания, но и других благ.<br><br>Дальше нужно спокойно отпустить желание во Вселенную и даже почти забыть о нем. Переживания и навязчивые мысли будут только мешать его исполнению. Поэтому есть:<br><br>Правило 7. Никогда не зацикливайтесь на своём желании<br>Отпустите свою мечту, но действуйте! Написав желание и спрятав листочек в укромный уголок, не думайте что это всё! Действуйте навстречу своей мечте, но (!) ни в коем случае на ней не зацикливайтесь. И, не нарушайте гармонию Вселенной, сметая всё и вся на своём пути, ради достижения Цели. Действуйте продуманно, разумно и Выше желание обязательно исполнится.',3,1433442115,1433442332,0,'26226',29286031,'http://cs624331.vk.me/v624331031/381db/qqvmAGDbkFY.jpg','Лера','Павлова',13,440,0),(156,'Сниму 2х. комнатную квартиру.',1,1433442586,1433442801,1,'74',182533273,'http://cs617128.vk.me/v617128273/eb68/kOigSttFZv4.jpg','Марина','Костерина',5,252,0),(157,'Сниму квартиру в Тюмени<br><br> интересует Европейский район или Заречный, рассмотрю все варианты!<br>за репост +100 к карме.',1,1433441855,1433442818,1,'8008',2373586,'http://cs623919.vk.me/v623919586/270dd/QE6_18VuDGE.jpg','Светлана','Башмакова',19,291,0),(158,'Срочно сдам 2-х комнатную квартиру (39 кв.м) в Ленинском р-не на длительный срок семейной паре!!! 11 тыс. руб. в месяц + электроэнергия!!! По всем вопросам обращаться по тел. 89199157270!!! Репост ',2,1433442714,1433442851,1,'4317',57081456,'http://cs627729.vk.me/v627729456/23dd/47giTDUXUKg.jpg','Катюша','Рылова',20,636,0),(159,'Сдаю двух комнатную квартиру, Ул.Габишева 29, 4 этаж, обустроена полностью  мебелью, есть тв, микроволновка. Хорошие, спокойные соседи, подробности в личку! За репост отдельное спасибо!',2,1433442653,1433442854,1,'2470',14676737,'http://cs622217.vk.me/v622217737/2feb3/d9Bl_jspDmI.jpg','Гульназ','Загидуллина',6,315,0),(161,'СДАЕТСЯ уютнейшая КОМНАТА (18 м2) в четырехкомнатной квартире на длительный срок!Собственник!Жили сами,еще не сдавалась ни разу.4 этаж,комнаты изолированные,10000 р/мес-все включено в стоимость(свет,вода,интернет Wifi). Мебель,есть холодильник,микроволновка,телевизор,чайник,плитка в комнате+плита с духовкой на общей ку