 близ места слияния pp. Караталы и Аят. К западу от села располагается Джабык-Карагайский бор (памятник природы). Село связано грунтовыми и шоссейными дорогами с соседними населенными пунктами; у южной окраины проходит ЮУЖД (участок Карталы — Магнитогорск). Расстояние до районного центра (Карталы) 25 км. На территории села расположены лесхоз, аннинский заповедник, охотничьи угодья, лесничество, железнодорожная станция, детский дом, детский сад, школа, больница, хорошая экология. Имеются музыкальная школа, ДК, спортзал, врачебная амбулатория и станция скорой медицинской помощи. В местной школе создан геологический музей. Живописное место, прекрасный вид. Не далеко от деревни протекает речка, озера, лес, удобные подъездные пути, в поселке развитая инфраструктура, магазины в шаговой доступности, дороги асфальтированы, регулярно ходит электричка. Собственник один. Можно под материнский капитал, с оформлением помогу. Цена 200000. Торг',4,1433496376,1433497940,1,'9620',38574722,'http://cs624818.vk.me/v624818722/334dd/UVbBmsNq7WQ.jpg','Ольга','Иванова',43,762,0),(188,'Юхуууу последний рабочий день,как закажу себе голубой кабриолет,куплю детское шампанское и домой',3,1433494037,1433497994,1,'2200',117509,'http://cs625218.vk.me/v625218509/12f29/TBxc0yddqe8.jpg','Катерина','Васильева',1,282,0),(189,'☁️<br><br>Банальных драмм, достаточно нам. <br>Не верь всем словам, тем, <br>что разносит по дворма людская молва. <br>Какая разница, да будь ты хоть сто раз права.<br>Если в любви нашей случился конкретный провал. <br>Ты сам себе враг, ты сам себе друг. <br>И вся наша жизнь, словно замкнутый круг. <br>Посуду ломать, пол ночи кричать. <br>И как на допросе, битые сутки молчать. <br>Но мы ведь это уже проходили. <br>Ругались, мирились, на сьемной квартире. <br>В нашем маленьком мире, случился пожар. <br>И пожарники всё затопили. <br>А помнишь кофе три в одном. <br>И мы на кухне рано утром, только вдвоём. <br>Как в той старой песне, мы будем вместе. <br>И я куплю тебе дом. <br><br>Вокзалы, аэропорты. <br>Предубеждение и гордость. <br>Когда комок где-то в горле. <br>И кончились все слова. <br>А помнишь жили так просто. <br>На белых кедах три полоски. <br>И мы вдыхали тот воздух. <br>С привкусом волшебства. <br><br>Всё пополам, такие дела. <br>Босиком на углях, я поднимаю белый флаг, глотая слова. <br>Я так устал тебе доказывать с пеной у рта. <br>Мы неделимый элемент, теорема проста. <br>Теплее, чем джаз, честнее, чем блюз. <br>Из магнитолы третий день, только добрая грусть. <br>И снова не то всё, снова не так. <br>И в голове моей, как в комнате нашей, бардак. <br>Зачем мы это всё нагородили? <br>И соседа послали, детей разбудили. <br>И пока не остыли, сотни сообщений, вот сам, и всё в этом стиле. <br>Я помню надпись под окном, <br>Ты написала на снегу, мы всё переживём. <br>Ты стоишь, улыбаясь, забыв про морозы. <br>И в руке сжимаешь балон. <br><br>Вокзалы, аэропорты. <br>Предубеждение и гордость. <br>Когда комок где-то в горле. <br>И кончились все слова. <br>А помнишь жили так просто. <br>На пятом тесте две полоски. <br>И мы вдыхали тот воздух. <br>С привкусом волшебства.(2х)',3,1433487541,1433498037,1,'11585',151475195,'http://cs621722.vk.me/v621722195/15c0d/BI_J0wzyV6w.jpg','Нюткин','Розанова',1,590,9),(190,'Смс: -Привет, киска! Как на счет того, чтобы встретиться? Я куплю бутылочку вина, квартира полностью в нашем распоряжении... - Заманчивое предложение. Только Кати дома нет. Это ее папа. Лучше пивасика возьми. Я скоро буду. Муур. .',3,1433486221,1433498045,1,'4507',145154841,'http://cs5151.vk.me/v5151841/19b0/vXFrEnFcgq4.jpg','Валерий','Воробей',50,342,0),(191,'Куплю себе собаку. Назову ее Хорошо. Вот приходишь домой, а там всегда Хорошо.',3,1433485597,1433498055,1,'280',291079711,'http://cs628722.vk.me/v628722711/3445/n5qYjHmx2G8.jpg','Юлечка','Ероскина',4,279,0),(192,'сейчас сбегаю зажигалку куплю тоже повод из дома выйти на карте нет денег....у сотового нет зубы....короче жопа полная',3,1433484976,1433498059,1,'16322',132522131,'http:/