я гарнитура, обеденная зона. Техника холодильник, газ.плита, стиральная машина, 1этаж 5этажки.<br><br>Адрес: ул, Монакова д.6а<br>Цена: 9000 (Все включено)<br>______________________________________<br>Звоните!<br>8-952-509-30-83',2,1433515597,1433517303,1,'1038',156493726,'http://cs624918.vk.me/v624918726/39d13/GmkuTH0csx0.jpg','Alina','Gainulina',7,678,0),(361,'Удалить заметку<br>Ср 19:49<br>СРОЧНО продам отличную ТРЕХКОМНАТНУЮ квартиру по низкой цене 2 350 000 руб. Квартира очень теплая, светлая ( окна на юг и на запад) на четвертом этаже кирпичного дома в тихом, спокойном районе, идеальном для семьи с детьми. В квартире евроокна, установлены новые межкомнатные двери. Санузел раздельный. Балкон застеклен. Входные две двери - железная и деревянная. Дружелюбные соседи, чистый, ухоженный подъезд. Хорошее месторасположение: до остановок общественного транспорта 3 минуты пешком. Окна выходят на 118 школу. Рядом находятся Детский диагностический центр,детская поликлиника №9, женская консультация, стоматология, ЖЭУ, Дорожно-строительный техникум, детские садики №362,342,355 (физического направления развития), школа 89, библиотека, детские клубы. Есть большая детская площадка, место для парковки автотранспорта.<br>Более трех лет в собственности ( один совершеннолетний собственник).<br>Возможна продажа по ипотеке.<br>Документы готовы к продаже.<br>Показ квартиры в удобное для Вас время.<br>Тел.8 908 576 2894',4,1433525706,1433526198,1,'634',12116069,'http://cs624019.vk.me/v624019069/303f0/rz_dVKcA4XQ.jpg','Анна','Семенова',7,957,0),(363,'Продам коттедж 4000000 руб. <br>1-этажный коттедж 136 м² (кирпич) на участке 8 сот., Свердловский тракт, 20 км от Челябинска.<br>Продам новый коттедж в Шигаево. Скважина, электричество подведено, газ рядом. Дом одноэтажный, кирпичный, черновая отделка.<br>Новый коттеджый поселок в экологически чистом месте, рядом лес и речка. Хорошие подъездные пути. Собственник.<br>Рассмотрю варианты обмена на квартиру, авто, стройматериалы и т.д. <br>Ребятки, репост плис ',4,1433522790,1433526264,1,'3675',22761932,'http://cs416919.vk.me/v416919932/7970/epAu5C622g8.jpg','Валерия','Бурангулова',7,579,0),(365,'#продамбилет#билетнаконцертmuse#muse Друзья, продаю 1 билет на Muse. Цена 6500₽. Пишите в WA+79166426860 @ дом Максимовых',4,1433525333,1433526343,1,'536',381851,'http://cs416618.vk.me/v416618851/3305/m_onCYLfzeg.jpg','Валерия','Максимова',1,641,0),(366,'7 правил, благодаря которым исполняются желания<br><br>Хотите, чтобы Ваше желание исполнилось? Читайте семь эзотерических правил! <br><br>Эзотерики считают, что наши желания исполнятся, если мы их правильно запишем. Дело в том, что те торнадо мыслей, которые крутятся у нас в голове, не могут быть зафиксированы Вселенной как желание. А вот если вы сумеете сосредоточиться на своем желании и следовать СЕМИ правилам, ваши желания обязательно сбудутся! Читайте, вникайте и забирайте на стену, чтобы не потерять.<br><br>Правило 1. Желание необходимо написать…<br><br>Обязательно запишите Ваше желание, старательно и красивым почерком. Легко сказать, но трудно сделать! Несмотря на кажущуюся простоту, правильно написать своё желание не так-то просто.<br><br>Давайте разберём на примерах: «Я хочу иметь свой дом». Правильно написано? Оказывается принципиально неправильно! Проблема в том, что такое желание может исполниться, но возникает вопрос: когда? Желания без точных сроков бессмысленны! Помните это. Поэтому следующее правило гласит:<br><br>Правило 2. Желание должно иметь время исполнения<br><br>Например: «Летом 2015 года я буду иметь большой, красивый коттедж». А вот если Вы станете думать: «Я куплю коттедж», – это будет ошибочно.  Написанное Вами, возможно, сбудется. Но в какое время – неизвестно. Поэтому прежде, чем писать желание, подумайте, когда вы хотите, чтобы оно исполнилось? (В разумных пределах, конечно). И только после этого приступайте к третьему правилу эзотерики:<br><br>Правило 3. Записывайте желание в настоящем времени<br><br>Иначе говоря, вместо: «Я куплю себе дом», надо написать: «Я купил себе дом». Важнейший момент! Т.е – вы должны представить, что дом у вас уже ЕСТЬ!  Вот еще одна часто встречающаяся ошибка: «Я не хочу быть бедным». Правильно написано? Да нет же, неправильно! И на то есть весомые причины.<br>1.Вселенная не воспринимает частицу «не», предлог «нет» и другие отрицательные слова. Вы говорите: «Не хочу быть бедным», а она, Вселенная, игнорируя частицу «не», получает посыл: «Хочу быть бедным!»<br>2.Мы как магнит притягиваем к себе то, о чём помышляем. Говоря себе: «Я не желаю быть бедняком», Вы автоматически притягиваете к себе бедность, поскольку (как мы уже говорили) Вселенная не воспринимает отрицательную частицу «не». Поэтому лучше говорить так: «Я хочу быть богатым и буду богатым!»<br><br>Правило 4. Запретите себе говорить: «не» и любые иные отрицания<br><br>Когда станете писать желание, обязательно сосредоточьтесь на нём и опишите его как можно подробнее. Отсюда вытекает правило номер пять:<br><br>Правило 5. Пишите подробно, эмоционально, с душой<br><br>Если Вы хотите заиметь новый дом, опишите его полностью, начиная от крыльца, расположения и количества комнат, заканчивая местечком, где поставите свою любимую вазу. Представьте свой восторг, когда въедете в новый дом и опишите его на бумаге. ОЧЕНЬ важно, чтобы Ваше желание не причинило вред другим людям, из этого постулата вытекает правило шестое:<br><br>Правило 6.  Записанное желание завершите молитвой или фразой-оберегом<br><br>Записав желание, смиренно попросите помощи Высших Сил. Если Вы верите в Бога – помолитесь об исполнении желания. Если атеист – придумайте свою фразу-оберег. Например: «Пусть мой будущий дом наполниться радостью и счастьем. Пусть мои дети и внуки продолжат здесь свой род и наполнят жизнь свою и мою любовью. Пусть это моё желание принесёт мне не только счастье, но и нечто большее».<br><br>Обратили внимание на формулировку: «нечто бОльшее?» Не нужно ограничивать Вселенную в ее усилиях помочь вам. Может быть, она сочтёт Вас достойным не только загаданного Вами желания, но и других благ.<br><br>Дальше нужно спокойно отпустить желание во Вселенную и даже почти забыть о нем. Переживания и навязчивые мысли будут только мешать его исполнению. Поэтому есть:<br><br>Правило 7. Никогда не зацикливайтесь на своём желании<br><br>Отпустите свою мечту, но действуйте! Написав желание и спрятав листочек в укромный уголок, не думайте что это всё! Действуйте навстречу своей мечте, но (!) ни в коем случае на ней не зацикливайтесь. И, не нарушайте гармонию Вселенной, сметая всё и вся на своём пути, ради достижения Цели. Действуйте продуманно, разумно и Выше желание обязательно исполнится.<br>____________________________________________________<br>Практикующий психолог, психотерапевт. Психологическое консультирование и психотерапия, работаю в гештальт-подходе <br>Запись по тел. 8(967)2708325 Жанна<br>Работаю с различными переживаниями и сложностями:<br>•детско-родительские и супружеские отношения;<br>•прояснение и разрешение конфликтов;<br>•одиночество, установление близких отношений, сложности в общении;<br>• проблемы со здоровьем, психосаматика;<br>• психологические травмы (через тело);<br>• низкая самооценка;<br>• проблемы в выражении чувств (злости, обиды, нежности, любви);<br>• сложности в понимании \" чего я хочу\", проблема выбора;<br>• сложности в женско-мужских отношениях, измены, расставания, разводы;<br>• переживание потери близкого человека;<br>•с проблемами личностного роста.',3,1433525764,1433526437,1,'957',54060251,'http://cs623822.vk.me/v623822251/347be/MMepL0nGCyc.jpg','Жанна','Кочетова',1,740,0),(368,'7 правил, благодаря которым исполняются желания.<br><br>Хотите, чтобы Ваше желание исполнилось? Читайте семь эзотерических правил!<br><br>Эзотерики считают, что наши желания исполнятся, если мы их правильно запишем. Дело в том, что те торнадо мыслей, которые крутятся у нас в голове, не могут быть зафиксированы Вселенной как желание. А вот если вы сумеете сосредоточиться на своем желании и следовать СЕМИ правилам, ваши желания обязательно сбудутся! Читайте, вникайте и забирайте на стену, чтобы не потерять.<br><br>Правило 1. Желание необходимо написать...<br><br>Обязательно запишите Ваше желание, старательно и красивым почерком. Легко сказать, но трудно сделать! Несмотря на кажущуюся простоту, правильно написать своё желание не так-то просто.<br><br>Давайте разберём на примерах: «Я хочу иметь свой дом». Правильно написано? Оказывается принципиально неправильно! Проблема в том, что такое желание может исполниться, но возникает вопрос: когда? Желания без точных сроков бессмысленны! Помните это. Поэтому следующее правило гласит:<br><br>Правило 2. Желание должно иметь время исполнения.<br><br>Например: «Летом 2015 года я буду иметь большой, красивый коттедж». А вот если Вы станете думать: «Я куплю коттедж», – это будет ошибочно. Написанное Вами, возможно, сбудется. Но в какое время – неизвестно. Поэтому прежде, чем писать желание, подумайте, когда вы хотите, чтобы оно исполнилось? (В разумных пределах, конечно). И только после этого приступайте к третьему правилу эзотерики:<br><br>Правило 3. Записывайте желание в настоящем времени.<br><br>Иначе говоря, вместо: «Я куплю себе дом», надо написать: «Я купил себе дом». Важнейший момент! Т.е – вы должны представить, что дом у вас уже ЕСТЬ! Вот еще одна часто встречающаяся ошибка: «Я не хочу быть бедным». Правильно написано? Да нет же, неправильно! И на то есть весомые причины.<br><br>Вселенная не воспринимает частицу «не», предлог «нет» и другие отрицательные слова. Вы говорите: «Не хочу быть бедным», а она, Вселенная, игнорируя частицу «не», получает посыл: «Хочу быть бедным!»<br>- Мы как магнит притягиваем к себе то, о чём помышляем. Говоря себе: «Я не желаю быть бедняком», Вы автоматически притягиваете к себе бедность, поскольку (как мы уже говорили)<br>- Вселенная не воспринимает отрицательную частицу «не». Поэтому лучше говорить так: «Я хочу быть богатым и буду богатым!»<br><br>Правило 4. Запретите себе говорить: «не» и любые иные отрицания.<br><br>Когда станете писать желание, обязательно сосредоточьтесь на нём и опишите его как можно подробнее. Отсюда вытекает правило номер пять:<br><br>Правило 5. Пишите подробно, эмоционально, с душой.<br><br>Если Вы хотите заиметь новый дом, опишите его полностью, начиная от крыльца, расположения и количества комнат, заканчивая местечком, где поставите свою любимую вазу. Представьте свой восторг, когда въедете в новый дом и опишите его на бумаге. ОЧЕНЬ важно, чтобы Ваше желание не причинило вред другим людям, из этого постулата вытекает правило шестое:<br><br>Правило 6. Записанное желание завершите молитвой или фразой-оберегом.<br><br>Записав желание, смиренно попросите помощи Высших Сил. Если Вы верите в Бога – помолитесь об исполнении желания. Если атеист – придумайте свою фразу-оберег. Например: «Пусть мой будущий дом наполниться радостью и счастьем. Пусть мои дети и внуки продолжат здесь свой род и наполнят жизнь свою и мою любовью. Пусть это моё желание принесёт мне не только счастье, но и нечто большее».<br><br>Обратили внимание на формулировку: «нечто бОльшее?» Не нужно ограничивать Вселенную в ее усилиях помочь вам. Может быть, она сочтёт Вас достойным не только загаданного Вами желания, но и других благ.<br><br>Дальше нужно спокойно отпустить желание во Вселенную и даже почти забыть о нем. Переживания и навязчивые мысли будут только мешать его исполнению. Поэтому есть:<br><br>Правило 7. Никогда не зацикливайтесь на своём желании.<br><br>Отпустите свою мечту, но действуйте! Написав желание и спрятав листочек в укромный уголок, не думайте что это всё! Действуйте навстречу своей мечте, но (!) ни в коем случае на ней не зацикливайтесь. И, не нарушайте гармонию Вселенной, сметая всё и вся на своём пути, ради достижения Цели. Действуйте продуманно, разумно и Выше желание обязательно исполнится.<br><br>#советы@mir_hitrostey',3,1433521624,1433526492,1,'398',255541379,'http://cs622421.vk.me/v622421379/361c8/WnFvJy_IokE.jpg','Аня','Шамрай',17,390,0),(369,'Куплю дом отпиши в лс о цене договоримся',3,1433519475,1433526510,1,'62',275456410,'http://cs628227.vk.me/v628227410/22ef/J_g-ZpEmiJE.jpg','Алексей','Байрамуков',10,264,0),(370,'Иду утром домой. На подъезде объявление: \"Дорогие соседи! Сегодня примерно в 9.20 у проходной двери были утеряны 120 руб. Если кто нашел, занесите, пожалуйста, в кв. 76 Антонине Петровне. Пенсия 3640 руб.\". Я откладываю 120 рублей, поднимаюсь, звоню. Открывает бабушка в фартуке. Только увидела меня, протягивающего деньги, сразу обниматься, причитать и в слезы счастья. И рассказала: \"Пошла за мукой, вернувшись, вынимала ключи у подъезда - деньги-то, наверное, и проронила\". НО! Деньги брать отказалась наотрез! Оказалось, за пару часов я уже шестой (!!!) \"нашел\" бабулины деньги! Люди, я вас люблю за то, что вы такие!!!<br><br>Работаю в кафе быстрого питания. Сегодня утром мужчина подошел к кассе и сказал: \"За мной стоит девушка, я ее не знаю. Но я хотел бы заплатить за ее кофе. Передайте ей \"Хорошего дня\". Эта девушка сильно удивилась сперва… а затем сделала то же самое для следующего за ней в очереди человека. И так 5 раз подряд!<br><br>Я тяжело болела ангиной. Дома была одна, не могла даже встать с кровати и плакала от беспомощности. Моя собака сидела рядом с кроватью и смотрела на меня с беспокойством. Потом ушла и вернулась с огромной вонючей замусоленной костью: она, видимо, у нее была припрятана на черный день. Кьяра положила кость на подушку и подталкивала носом к моему лицу - \"Погрызи!\".<br><br>Нашла сегодня мобильник покойного мужа. Зарядила. Оказалось, там есть новые сообщения. Дочка шлет и шлет их ему: рассказывает все важные новости и вообще как у нас дела...<br><br>Как-то увидел на улице бабушку, продавала всего 1 единственный комнатный цветок фиалку. Стало ее жалко, заплатил раз в 10 дороже чем она просила. Она со слезами: \"побежала я в магазин куплю деду колбасу\". Принес цветок домой, на следующее утро он расцвел.<br><br>Давно не было такой грозы, как сегодня. На работе сказали, что кто-то отирается около моей машины. Я бросился на улицу. Все было по-прежнему, кроме люка в крыше: кто-то задвинул его поплотнее, чтобы машина не пострадала в непогоду.<br><br>В магазине ко мне подошла маленькая девочка и попросила: \"Возьми меня на ручки\". Я так и сделала, подумав, что она потерялась. Малышка просто обняла меня, а потом спрыгнула. Я уставилась на нее, а она объяснила:<br>- Хотела, чтоб ты улыбнулась.<br>Я так и прыснула со смеху.<br><br>Недавно возвращалась из института и возле станции метро увидела ветерана войны. Он сидел рядом с планшетом, на котором были медали и ордена... Его награды, который он заслужил на войне. Он продавал их, чтобы купить себе хоть какой-то еды. Я подошла, вытащила все содержимое кошелька и отдала ему со словами: \"Возьмите все мои деньги, но не продавайте свою честь и доблесть за гроши людям, которые этого недостойны...\" Он расплакался, взял деньги, собрал ордена в ладони и поцеловал их, а потом тихо сквозь слезы произнес: \"Спасибо, дочка\". В такие моменты мне кажется, что я смогу изменить мир. Они дают мне надежду.<br><br>Давайте делать друг другу маленькие приятности. От этого не только наши души, но и весь мир станет светлее и добрее.',3,1433519440,1433526513,1,'1685',136853471,'http://cs624221.vk.me/v624221471/3030e/VmK31dLMabA.jpg','Динара','Ягафарова',5,570,0),(372,'Сниму квартиру! Однокомнатную, без мебели или частично, в хорошем состояние! Не дорого! Сообщения в л/ с!',1,1433525140,1433526956,1,'2492',54229699,'http://cs618425.vk.me/v618425699/1dcb9/A5QVxQweM10.jpg','Маргарита','Каирова',82,288,0),(373,'СНИМУ 2-Х КОМНАТНУЮ КВАРТИРУ,НА ДОЛГИЙ СРОК В ПРИМОРСКОМ РАЙОНЕ,СРОЧНО!!!!!!!!!!ПО ВСЕМ ПРЕДЛОЖЕНИЯМ ПИШИТЕ В ЛИЧКУ ИЛИ ЗВОНИТЕ ПО ТЕЛЕФОНУ 8921 564 14 22 РОМАН!СПАСИБО!',1,1433523821,1433526982,1,'3125',77220793,'http://cs622516.vk.me/v622516793/35d6b/kRm8FcYkTK0.jpg','Tania','Продажа вешей',2,324,0),(374,'СНИМУ 2-Х КОМНАТНУЮ КВАРТИРУ,НА ДОЛГИЙ СРОК В ПРИМОРСКОМ РАЙОНЕ,СР