4,1433868370,1433870567,1,'2426',93140522,'http://cs629423.vk.me/v629423522/19bf/XIqtv0txTZ8.jpg','Анна','Кустова',30,273,0),(414,'Срочно Продам 3-х комнатную квартиру на Невском проспекте 3/6К.общ.118кв.м.СУР,кухня 14кв.м. отличный ремонт.Пр.ПР.из квартиры все выписаны.(продажа по сниженной цене) с 12 000 000 до 9 000 000 млн.руб.Срочно!',4,1433866604,1433870591,1,'3130',53615304,'http://cs314328.vk.me/v314328304/853a/QTIZ2DXHe2E.jpg','Анна','Беляева',2,363,0),(415,'РОДАЮ ДОМ!2-этажный дом 500 м2(кирпич)на участке 2 сот.,в черте города.  Срочно продам два дома в одном дворе маленький дом 50кв 3 комнаты ванная туалет и кухня двух этажный 500кв/м имеются 5 комнат кухня туалет ванная два больших коридора помещение под магазин и гараж ...89171809442',4,1433870302,1433870624,1,'16',305107440,'http://cs623917.vk.me/v623917440/309c5/b6VCeX12WF4.jpg','Сакинат','Ахмедова',32,1040,0),(416,'Куплю себе собаку. Назову ее Хорошо. Вот приходишь домой, а там всегда Хорошо.',3,1433869377,1433870698,1,'1172',28352608,'http://cs628022.vk.me/v628022608/7261/lobKbLwUn10.jpg','Ксюша','Вандыш',129,279,0),(417,'Жизненные правила Инес де ля Фрессанж<br>Гуру парижского шика и муза дизайнеров Инес де ля Фрессанж о своем стиле, о сексуальности, о любви и о том, каково это — быть эталонной парижанкой<br><br>9 Июня Анастасия Соколова<br><br>Инес де ля Фрессанж в своем парижском офисе Roger Vivier<br>Мы с Инес встречаемся в Москве, в кафе на втором этаже ЦУМа, — вместе с дизайнером Бруно Фризони она приехала представить новую коллекцию обуви Roger Vivier, чьим послом без малого пятнадцать лет является. Маркиза де ля Фрессанж, так ее следует называть по праву рождения, с ходу заказывает горячий шоколад — замерзла. На ней — синий жакет и джинсы-дудочки, длинное колье из тонких цепочек с прозрачными камнями — даже не зная, кто передо мной, я все равно узнала бы в ней француженку: только они умеют так эффектно выглядеть в самых простых вещах.<br><br>2.jpg<br>ФОТО: АНДРЕА БЛЭНЧ, VOGUE US, 1983<br><br>О ПАРИЖСКОМ ШИКЕ <br><br>Когда люди видят мой гардероб, испытывают разочарование: представляют комнату, доверху набитую подарками от Карла Лагерфельда и Ива Сен-Лорана, а вместо этого обнаруживают джинсы, джинсы, джинсы и много темно-синих свитеров и жакетов. Я часто покупаю одежду, но это всегда одинаковые вещи на каждый день. Если предстоит выход в свет, надеваю расшитый блестками черный жакет Lanvin, который мне прислал Альбер Эльбаз, он всегда к месту. Раньше я могла зайти в Chanel и взять любую вещь, и сегодня в Roger Vivier могу взять любые туфли, но все-таки не уношу домой всю коллекцию. После стольких лет работы в моде я знаю, что мне немногое нужно, важно уметь выбрать. Раньше в домах богатых людей стояли драгоценные вещицы, висели картины в тяжелых рамах, все дышало избытком. Сегодня там — серая сталь, минимализм, пусто и просто. Все изменилось радикально! В том числе и в моде: чем скромнее ты одет, чем сдержаннее макияж, тем шикарнее ты выглядишь. Сумка Kelly Hermès, тренч Burberry, белая сорочка Uniqlo, балетки с пряжками Roger Vivier — все это я ношу много лет и не променяю ни на какие обновки.<br><br>О ДЕТСТВЕ <br><br>С рождения я была окружена красавицами: моя мама и ее подруги были моделями — одна из них была любимицей самой Шанель. В детстве я восхищалась маминой подругой, которая одевалась в стиле хиппи-шик: у нее были длинные этнические платья и сапожки, но идеальные волосы, продуманный макияж, я обожала это сочетание ухоженности и небрежности. Наша семья жила в загородном доме, и однажды мама приютила на полгода коммуну художников: они были бедны, а у нас было много места. Одна половина той группы занималась искусством, а другая — театром. Уезжая, в знак благодарности они устроили вечеринку: расставили статуи, развесили картины, выкрасили наш рояль в розовый — на нем возлежала похожая на Джерри Холл блондинка. В восемнадцать я начала карьеру модели и приехала на кастинг к Кензо: я тогда была стеснительная, а Кензо вообще человек застенчивый, мы не могли разговаривать. И вдруг меня увидела одна из его помощниц: «Это же Инес, ее мама помогла нам, когда мы голодали! Ты обязан ее взять». И он меня взял. Да, помощница была одной из тех бездомных артисток.<br><br>1.jpg<br>￼С КАРЛОМ ЛАГЕРФЕЛЬДОМ В АТЕЛЬЕ CHLOÉ, ПАРИЖ, 1983<br><br>О МАМЕ И ДОЧКЕ<br><br>￼￼У моей бабушки была крокодиловая сумка — я ее терпеть не могла, мне она казалась такой не модной. Родители воспитали меня в уважении не к дорогим вещам, а к таланту, экстравагантности и стремлению отличаться. Моя мама любила Шопена и Моцарта, но еще — Тину Тернер и The Rolling Stones. И таким же разным был и стиль моей семьи: бабушка носила наряды Высокой моды, а мама — цыганские юбки. Это крайне важно в наши дни — дать детям разные образы, показать варианты. Какие отношения с модой у моих дочек? Они обожают наряжаться, у них классные вещи. Недавно я поймала себя на мысли, что мне бы хотелось одолжить у старшей, Нины, джинсовую мини-юбку APC, но я знаю, что мое время прошло, и просто любуюсь ею со стороны, она такая хорошенькая и так идет моей дочке. Сама я не против, когда девочки одалживают мои вещи. Хотя, бывает, ругаюсь: куплю кашемировый свитер Prada, который стоит целое состояние, принесу домой, а наутро пакет с обновкой из моей комнаты уже исчез. Кричу: «Как так можно, я ведь его ни разу не надела»!<br><br>О МОДНЫХ НАХОДКАХ <br><br>Я без ума от творчества Фиби Фило из Céline: когда вхожу в этот магазин — теряю волю. Еще люблю Isabel Marant и Margaret Howell — про последнюю знаю, что там покупает вещи и Фиби. Из недавних открытий: японская марка 45R — дороговато, но как же круто! Их жакеты выглядят так, словно до тебя их носили какие-то крестьяне, но они прекрасны. У меня есть их пиджак из бархата, его нельзя назвать нарядным, но я знаю, что буду хранить его до конца своих дней. Другие фавориты последних лет: австралийская марка I Love Mr. Mittens — огромные карди- ганы и свитеры, Marie-Hélène de Taillac — это ювелирные украшения. Я счастлива подарить эти имена читательницам русского Vogue!<br><br>О ПАРИЖЕ И ПАРИЖАНКАХ<br><br>Сейчас в книжных магазинах есть целые стенды на тему «Будь как парижанка!», а начала все это я. В 2010 году я написала книгу «Парижанка и ее стиль» — и ее перевели на семнадцать языков. Но я не считаю, что француженки могут «учить», это было бы слишком претенциозно. Мы не лучше и не хуже других. И свой стиль есть не только у нас! Посмотрите на африканских женщин: роскошные ткани, буйные краски, принты — это стиль, и он прекрасен. Когда писала «Парижанку», я просто хотела дать адреса своего Парижа — любимых кафе и магазинчиков, — но мой редактор попросил вписать пару советов, как и что носить, чтобы сойти в городе за свою. Мне стало интересно порассуждать на тему. Но хочу подчеркнуть: все эти «великолепные парижанки», которыми восхищаются в мире, часто даже не француженки, а приехавшие из других стран девушки! Многие думают, что французская элегантность — это костюм-двойка, шляпка и сумочка. Глупости! У нас маленькая страна, но мы пригласили к себе венгров, русских, испанцев, немцев, чтобы они сделали Францию такой, какая она сегодня, — яркой и разной. У каждого есть фотографии, на которых он одет во что-то ужасное. И я не исключение — у меня таких, может быть, даже больше, чем у других, ведь я работала с безумными дизайнерами, примеряла самые странные прически! Но я не зациклена на себе — у меня дома вы не увидите ни одного моего портрета. Ну хорошо, две фотографии спрятаны в гардеробной: это мои снимки работы Ги Бурдена и Паоло Роверси.<br><br>3.jpg<br>С ДОЧЕРЬМИ НИНОЙ И ВАЙОЛЕТ, ФОТО: ПАТРИК ДЕМАРШЕЛЬЕ, 2009<br><br>О СЕКСУАЛЬНОСТИ <br><br>Несколько последних сезонов в моде прошли под знаком отказа от высоких каблуков — и я рада, что еще больше женщин поняли, что могут прожить и без них. Но до сих пор многие думают, что шпильки — синоним сексуальности. Посмотрите на фотографии Мэрилин Монро: она в свитере и бриджах, на ногах — тенниски или балетки. Выглядит ли она при этом сексуально? О да! Вы не подумайте, я не против каблуков. Но все дело в стиле: к некоторым вещам больше подходят каблуки (например, я могу надеть их с джинсами и толстым свитером или двубортным жакетом днем), а к некоторым — нет. Положим, муслиновые платья со шпильками можно надеть разве что на свадьбу престарелой тетушки — это так несовременно! А вот с балетками оно будет смотреться мило, а с байкерскими ботинками — круто. Мне кажется, журналы мод нужны именно для того, чтобы объяснять такие вещи.<br><br>О ГЕНИАЛЬНОМ РОЖЕ ВИВЬЕ<br><br>Я была знакома с обувщиком Роже Вивье лично, он — легенда мира моды: он создал первые туфли на шпильках, придумал балетки с крупной пряжкой, он делал обувь для Диора и Сен-Лорана, он был таким талантливым! Но последние двадцать лет его имя было незаслуженно забыто. Поэтому, когда в 2001 году ко мне обратился владелец Roger Vivier и предложил стать частью команды, которая возродит марку, я немедленно ответила «да». Хотя браться за эту работу в тот момент было рискованно — после 11 сентября индустрия моды была в тяжелом положении и запускать новую марку было безумием. Но знаете, когда ты замужем, у тебя уже есть дом и ребенок, риск — лучшее, что может случиться в жизни. И кстати, люди в России это понимают, вы часто говорите «ура» риску! Поэтому, когда приезжаю в Москву, чувствую себя как дома.<br><br>О ПЛАНАХ<br><br>В январе прошлого года после каникул я пришла в офис и сказала помощнице: «Дорогая, в этом году будем мало работать! Я хочу чаще встречаться с друзьями, хочу путешествовать, хочу наконец заняться йогой и избавиться от этого животика!» Но через пару недель мне позвонили с предложением сделать коллекцию для Uniqlo. Потом я встретила знакомого: «Инес, L’Oréal очень нравится, как ты выглядишь, они хотят снять тебя в ролике и при- гласить на красную дорожку в Канны». Я что, должна была им всем ответить: «Нет, останусь-ка я дома, ведь я так люблю йогу!» В итоге смотрю на свой график — и я в шоке. Но я счастлива заниматься интересным делом и понимаю, что, может быть, через три года люди уже ничего у меня не попросят. Когда была молода, я думала: «Нужно что-то делать, чтобы было что оставить после себя». Про меня даже шутили: в высшем обществе Инес единственная, кто работает! Но сейчас я думаю, что если ты окружена людьми, которые тебя любят и которых любишь ты, — вот настоящий успех. Нужно прожить жизнь, чтобы понять это.<br><br>ТЕГИ: журнал  Инес де ла Фрессанж  парижский стиль',3,1433863718,1433870750,1,'40296',109980769,'http://cs307704.vk.me/v307704769/3f5d/2p1VseHjTYU.jpg','Людмила','Шитова',2,390,0),(418,'Я снова в поисках жилья ! Сниму комнату в пределах 10т.р.; Район значения не имеет.   Без детей, без животных. Оплату в срок гарантирую. Заранее спасибо!',1,1433869675,1433870985,1,'2795',106361368,'http://cs628225.vk.me/v628225368/44e9/lJv3cEgBgLE.jpg','Алинка','Якоб',2,315,0),(419,'Срочно, очень срочно. Сниму комнату в Москве. У кого есть знакомые? Может кто-то ищет соседку чтобы разделить оплату небольшой квартиры?<br>Готова платить 15.000-18.000 руб.',1,1433868912,1433870999,1,'3623',100158,'http://cs620127.vk.me/v620127158/195b7/Z_0otDfEwmk.jpg','Александра','Войтенко',2,324,0),(420,'Срочно сниму однокомнатную квартиру или двушку !!!! 89500015700!!!',1,1433870632,1433871047,1,'2331',97199914,'http://cs621628.vk.me/v621628914/3c3a0/l19wh8zH62U.jpg','Сергей','Блинков',2,561,0),(421,'Срочно сниму 1-ю квартиру в г.Новосибирск.Рассмотрю все варианты.Друзья,репостим.Спасибо.',1,1433870224,1433871054,1,'5739',58640140,'http://cs625417.vk.me/v625417140/289b9/hNzjNoW7VWY.jpg','Анастасия','Максимова',3,282,0),(423,'Сдаю квартиру. 1 место для девушки. Комната вторая на 2 места. За перепост спасибо)))',2,1433870380,1433871089,1,'9897',194142570,'http://cs421426.vk.me/v421426570/178f/jn3toMvFnJA.jpg','Светлана','Букина',11,282,0),(424,'Сдам комнату<br>Комната 20 м² в 2-к квартире на 11 этаже 15-этажного монолитного дома<br>Соболева 19 ЖК АВРОРА<b