ое, и проронила\". НО! Деньги брать отказалась наотрез! Оказалось, за пару часов я уже шестой (!!!) \"нашел\" бабулины деньги! Люди, я вас люблю за то, что вы такие!!!<br><br>Работаю в кафе быстрого питания. Сегодня утром мужчина подошел к кассе и сказал: \"За мной стоит девушка, я ее не знаю. Но я хотел бы заплатить за ее кофе. Передайте ей \"Хорошего дня\". Эта девушка сильно удивилась сперва… а затем сделала то же самое для следующего за ней в очереди человека. И так 5 раз подряд!<br><br>Я тяжело болела ангиной. Дома была одна, не могла даже встать с кровати и плакала от беспомощности. Моя собака сидела рядом с кроватью и смотрела на меня с беспокойством. Потом ушла и вернулась с огромной вонючей замусоленной костью: она, видимо, у нее была припрятана на черный день. Кьяра положила кость на подушку и подталкивала носом к моему лицу - \"Погрызи!\".<br><br>Нашла сегодня мобильник покойного мужа. Зарядила. Оказалось, там есть новые сообщения. Дочка шлет и шлет их ему: рассказывает все важные новости и вообще как у нас дела...<br><br>Как-то увидел на улице бабушку, продавала всего 1 единственный комнатный цветок фиалку. Стало ее жалко, заплатил раз в 10 дороже чем она просила. Она со слезами: \"побежала я в магазин куплю деду колбасу\". Принес цветок домой, на следующее утро он расцвел.<br><br>Давно не было такой грозы, как сегодня. На работе сказали, что кто-то отирается около моей машины. Я бросился на улицу. Все было по-прежнему, кроме люка в крыше: кто-то задвинул его поплотнее, чтобы машина не пострадала в непогоду.<br><br>В магазине ко мне подошла маленькая девочка и попросила: \"Возьми меня на ручки\". Я так и сделала, подумав, что она потерялась. Малышка просто обняла меня, а потом спрыгнула. Я уставилась на нее, а она объяснила:<br>- Хотела, чтоб ты улыбнулась.<br>Я так и прыснула со смеху.<br><br>Недавно возвращалась из института и возле станции метро \"Автозаводская\" увидела ветерана войны. Он сидел рядом с планшетом, на котором были медали и ордена... Его награды, который он заслужил на войне. Он продавал их, чтобы купить себе хоть какой-то еды. Я подошла, вытащила все содержимое кошелька и отдала ему со словами: \"Возьмите все мои деньги, но не продавайте свою честь и доблесть за гроши людям, которые этого недостойны...\" Он расплакался, взял деньги, собрал ордена в ладони и поцеловал их, а потом тихо сквозь слезы произнес: \"Спасибо, дочка\". В такие моменты мне кажется, что я смогу изменить мир. Они дают мне надежду.<br><br>Давайте делать друг другу маленькие приятности. От этого не только наши души, но и весь мир станет светлее и добрее.',3,1433935380,1433946408,1,'7726',36938725,'http://cs628029.vk.me/v628029725/3394/Fp-xpzQzq_g.jpg','Viktoriya','Manoshkina',1,720,2),(487,'куплю авто митсубиши-аутлендер,паджеро,или поменяю на дачу с 2-х этажным домом.помогу в перевозке овощей и т.д.тел.77-21-85.игорь николаевич',3,1433933758,1433946418,1,'2',308704560,'http://cs627925.vk.me/v627925560/57c4/QLRP7qSeMh4.jpg','Игорь','Лукин',36,621,0),(488,'Встречаются 3 похуиста. Один говорит: <br>- У меня вчера машину угнали, а мне пох я себе новую куплю.<br>Второй: <br>- Это фигня, у меня на этой неделе квартиру подняли, а что не вынесли то сожгли, а мне пох я себе новую хату куплю с прибамбасами! <br>Третий: <br>- Да это тоже фигня, вот вчера захожу в свой подьезд, а там стоят 3 амбала и спрашивают меня: Ты Коля? Я говорю: Ну. Они взяли и отпиздили меня, а мне пох, я не Коля!!',3,1433945122,1433946447,1,'12984',14747158,'http://cs629307.vk.me/v629307158/2883/0TkL4y_z3tE.jpg','Анастасия','Бозина',5,474,0),(489,'Куплю 2-комнатную квартиру-хрущевку в СЗР за наличные!!! Пишите в лс',3,1433944450,1433946451,1,'1958',2783277,'http://cs627217.vk.me/v627217277/4b4a/05TUbQQ0m2k.jpg','Наталия','Степанова',38,276,0),(491,'сниму 1 комнотную квартиру с мебелью в черняховске до 4000 руб.',1,1433944847,1433946671,1,'249',133600399,'http://cs624329.vk.me/v624329399/371e6/JWPfXv5DydQ.jpg','Константин','Соколов',39,273,0),(492,'Сниму 2х-3х ком